				$obj1->hydrate($row);
				ResultadoPeer::addInstanceToPool($obj1, $key1);
			} // if $obj1 already loaded

			$key2 = PreEnriqPeer::getPrimaryKeyHashFromRow($row, $startcol);
			if ($key2 !== null) {
				$obj2 = PreEnriqPeer::getInstanceFromPool($key2);
				if (!$obj2) {

					$cls = PreEnriqPeer::getOMClass(false);

					$obj2 = new $cls();
					$obj2->hydrate($row, $startcol);
					PreEnriqPeer::addInstanceToPool($obj2, $key2);
				} // if obj2 already loaded
				
				// Add the $obj1 (Resultado) to $obj2 (PreEnriq)
				$obj2->addResultado($obj1);

			} // if joined row was not null

			$results[] = $obj1;
		}
		$stmt->closeCursor();
		return $results;
	}


