		PreEnriqPeer::addSelectColumns($criteria);
		$startcol3 = $startcol2 + (PreEnriqPeer::NUM_COLUMNS - PreEnriqPeer::NUM_LAZY_LOAD_COLUMNS);

		EnriqPeer::addSelectColumns($criteria);
		$startcol4 = $startcol3 + (EnriqPeer::NUM_COLUMNS - EnriqPeer::NUM_LAZY_LOAD_COLUMNS);

		MedioPeer::addSelectColumns($criteria);
		$startcol5 = $startcol4 + (MedioPeer::NUM_COLUMNS - MedioPeer::NUM_LAZY_LOAD_COLUMNS);

		TempIncubacionPeer::addSelectColumns($criteria);
		$startcol6 = $startcol5 + (TempIncubacionPeer::NUM_COLUMNS - TempIncubacionPeer::NUM_LAZY_LOAD_COLUMNS);

		TiempoIncubacionPeer::addSelectColumns($criteria);
