					$obj3 = new $cls();
					$obj3->hydrate($row, $startcol3);
					EnriqPeer::addInstanceToPool($obj3, $key3);
				} // if obj3 loaded

				// Add the $obj1 (Resultado) to the collection in $obj3 (Enriq)
				$obj3->addResultado($obj1);
			} // if joined row not null

			// Add objects for joined Medio rows

			$key4 = MedioPeer::getPrimaryKeyHashFromRow($row, $startcol4);
			if ($key4 !== null) {
				$obj4 = MedioPeer::getInstanceFromPool($key4);
