				} // if obj5 loaded

				// Add the $obj1 (Resultado) to the collection in $obj5 (TempIncubacion)
				$obj5->addResultado($obj1);
			} // if joined row not null

			// Add objects for joined TiempoIncubacion rows

			$key6 = TiempoIncubacionPeer::getPrimaryKeyHashFromRow($row, $startcol6);
			if ($key6 !== null) {
				$obj6 = TiempoIncubacionPeer::getInstanceFromPool($key6);
				if (!$obj6) {

