			$key7 = MuestraPeer::getPrimaryKeyHashFromRow($row, $startcol7);
			if ($key7 !== null) {
				$obj7 = MuestraPeer::getInstanceFromPool($key7);
				if (!$obj7) {

					$cls = MuestraPeer::getOMClass(false);

					$obj7 = new $cls();
					$obj7->hydrate($row, $startcol7);
					MuestraPeer::addInstanceToPool($obj7, $key7);
				} // if obj7 loaded

				// Add the $obj1 (Resultado) to the collection in $obj7 (Muestra)
				$obj7->addResultado($obj1);
			} // if joined row not null

			$results[] = $obj1;
		}
		$stmt->closeCursor();
		return $results;
